import React from "react"; 
import "./Plataformas.css";
import trashBin from "../Assets/Imagenes/TrashBin.png";

const Plataformas = () => {
  return (
    <div className="plataforma-container">
      <div className="plataforma-left-side">
        <h2 className="plataforma-registro-text">PLATAFORMAS REGISTRADAS</h2>
        <div className="plataforma-category-list">
          <img src={trashBin} alt="Eliminar" className="plataforma-trash-icon" />
        </div>
      </div>
      <div className="plataforma-right-side">
        <div className="plataforma-input-group">
          <div className="plataforma-text">NOMBRE DE LA PLATAFORMA</div>
          <input type="text" id="category-name" className="plataforma-input-field" />
        </div>
        <div className="plataforma-input-group">
          <div className="plataforma-text">AÃ‘O DE LANZAMIENTO</div>
          <textarea id="category-description" className="plataforma-textarea-field"></textarea>
        </div>
        <button className="plataforma-register-button">REGISTRAR NUEVA PLATAFORMA</button>
        <button className="plataforma-edit-button">CONFIRMAR EDICION</button>
      </div>
    </div>
  );
};

export default Plataformas;
